import React from "react";


const Repository = props => (
    <React.Fragment>
       { props.repository.map((commit , index) => {
        return (
            <React.Fragment key= { index }>
                <p> { commit.url }</p >
                <a href= { commit.html_url } >See on Github</a>
            </React.Fragment>
        )
    })
    }
    </React.Fragment>
)

export default Repository
